import React from "react"
import ContentLoader from "react-content-loader"

const Skeleton = (props) => (
  <ContentLoader 
    speed={2}
    width={220}
    height={500}
    viewBox="0 0 220 500"
    backgroundColor="#f3f3f3"
    foregroundColor="#ecebeb"
    {...props}
  >
    <rect x="15" y="26" rx="0" ry="0" width="220" height="254" /> 
    <rect x="56" y="295" rx="10" ry="10" width="142" height="21" /> 
    <rect x="100" y="336" rx="10" ry="10" width="50" height="21" /> 
    <rect x="102" y="373" rx="10" ry="10" width="48" height="21" /> 
    <rect x="52" y="415" rx="10" ry="10" width="150" height="27" />
  </ContentLoader>
)

export default Skeleton;
